import React from "react";
import "./css/CovidAdd.css";

function CovidAdd() {
  return (
    <div className="covid">
      <div className="alert__text">
        <p>UPDATE NEWS ABOUT Information about Covid-19 vaccine</p>
      </div>
      <div className="date__container"></div>
    </div>
  );
}

export default CovidAdd;
